import styled from "styled-components";

export const Wrapper = styled.div`
background-color: black;
width: 300px;
height: 300px;
width: 250px;
height: 250px;
`;

export const Content = styled.div`
display: flex;
width: 100%
`;

export const Image = styled.img`
width: 100%;
`;
